import React from 'react'
import { useHistory } from 'react-router-dom'
import "./style.css"

const Home = () => {
    const items = [{id:0 , city : "Riyadh" ,country:"Saudi Arabia" ,favorit:false, liking:"like" , img :`data:image/jpeg;base64,
    `},
{id:1 ,city: "Dubai" , country :"UAE" ,favorit:false,liking:"like", img:`data:image/jpeg;base64,

`},
{id:2 , city : "Manama" , country:"AlBahrayn" ,favorit:false,liking:"like", img:`data:image/jpeg;base64,
`}]
 
//localStorage.setItem("SListItem",JSON.stringify(items));
const cards=JSON.parse(localStorage.getItem("SListItem")) || items;

  const history = useHistory();
 

  const changeRoute = (id)=>{
      history.push(`/Card/${id}`);
  }
  const addLike = (id)=>{
      cards[id].favorit= !cards[id].favorit;
      if(cards[id].favorit){
        cards[id].liking="unlike";
       }else{
        cards[id].liking="like"  
       }
      localStorage.setItem("SListItem",JSON.stringify(cards));


  }
  
 

  return (
        <div className="cards">
            {cards.map((item,i)=>
            <div className="card"  key={item.id}>
                <h1>{item.city}</h1>
                <h2>{item.country}</h2>
                <img src={item.img} onClick={()=>changeRoute(item.id)} alt="img city" />
                <button  onClick={()=>addLike(item.id)} >{item.liking}</button>
                </div>)}
        </div>
    )
}

export default Home;
